import React, { useState } from "react";
import Modal from "./Modal";

function Account() {
  // Sample data to demonstrate the table
  const data = {
    id: 1,
    first_name: "John",
    last_name: "Doe",
    username: "johndoe",
    email: "john@example.com",
    age: 30,
    location: "New York",
    gender: "Male",
    seeking_gender: "Female",
    marital_status: "Single",
    bio: "Lorem ipsum dolor sit amet...",
    interest: "Hiking, Photography",
    height: "6'2\"",
    ethinicity: "Caucasian",
    living_with: "Alone",
    education_level: "Bachelor's Degree",
    no_of_children: "0",
    drinking_habits: "Social Drinker",
    smoking_habits: "Non-Smoker",
    passion: "Traveling, Music",
    account_status: "Active",
    user_id: 101,
    created_at: "2023-07-23 12:34:56",
  };

  const [isModalOpen, setIsModalOpen] = useState(false);

  const handleEditClick = () => {
    setIsModalOpen(true);
  };

  const handleModalClose = () => {
    setIsModalOpen(false);
  };

  return (
    <div className="account">
      <table>
        <tbody>
          <tr>
            <td>ID:</td>
            <td>{data.id}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>First Name:</td>
            <td>{data.first_name}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Last Name:</td>
            <td>{data.last_name}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Username:</td>
            <td>{data.username}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Email:</td>
            <td>{data.email}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Age:</td>
            <td>{data.age}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Location:</td>
            <td>{data.location}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Gender:</td>
            <td>{data.gender}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Seeking Gender:</td>
            <td>{data.seeking_gender}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Marital Status:</td>
            <td>{data.marital_status}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Bio:</td>
            <td>{data.bio}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Interest:</td>
            <td>{data.interest}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Height:</td>
            <td>{data.height}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Ethinicity:</td>
            <td>{data.ethinicity}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Living With:</td>
            <td>{data.living_with}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Education Level:</td>
            <td>{data.education_level}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>No. of Children:</td>
            <td>{data.no_of_children}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Drinking Habits:</td>
            <td>{data.drinking_habits}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Smoking Habits:</td>
            <td>{data.smoking_habits}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Passion:</td>
            <td>{data.passion}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Account Status:</td>
            <td>{data.account_status}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>User ID:</td>
            <td>{data.user_id}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
          <tr>
            <td>Created At:</td>
            <td>{data.created_at}</td>
            <td>
              <button onClick={handleEditClick}>Edit</button>
            </td>
          </tr>
        </tbody>
      </table>

      <Modal isOpen={isModalOpen} onClose={handleModalClose}>
        <h2>Edit Details</h2>
        <form>
          <label>
            ID:
            <input type="text" name="id" value={data.id} readOnly />
          </label>
          <label>
            First Name:
            <input
              type="text"
              name="first_name"
              value={data.first_name}
              onChange={handleChange}
            />
          </label>
          <label>
            Last Name:
            <input
              type="text"
              name="last_name"
              value={data.last_name}
              onChange={handleChange}
            />
          </label>
          {/* Render other input fields similarly */}
          {/* ... */}
          <button onClick={handleModalClose}>Save</button>
        </form>
      </Modal>
    </div>
  );
}

export default Account;
